import React,{ useEffect, useState } from "react";
import axios from 'axios';
import JSOG from "jsog";
import { Analysis } from "../Models/Analysis";


function AnalysisContainer(props){
    let [analysis, setAnalysis] = useState([]);
    let [title, setTitle] = useState("");
    let [keywords, setKeywords] = useState("");
    let [analysisQue, setAnalysisQue] = useState([]);
    let [edit, setEdit] = useState(false);
    let [counter, setCounter] = useState(0);
    let [ofTitle, setOfTitle] = useState(true);
    let [newAnalysis, setNewAnalysis] = useState(false);
    let [isTrue, setIsTrue] = useState(false);
    let [dateFrom,setDateFrom]=useState("");
    let [dateTo, setDateTo]=useState("");

    let filter = () => {
        setAnalysis([]);    
        let newAnalysis = [];   
        if(keywords.trim() !== '' || title.trim() !== ''){
            for(let analysis of analysisQue){
                if(analysis.title.indexOf(title) >= 0 || analysis.keyTakeaways.indexOf(keywords) >= 0 
                || analysis.content.indexOf(keywords) >= 0 ||(dateFrom!="" && analysis.dateFrom >= dateFrom) 
                ||(dateTo!="" && analysis.dateTo <= dateTo)){
                    newAnalysis.push(analysis);
                }
            }
        }
        setAnalysis(newAnalysis);
    }

    let Filtering = (e) => {
        setOfTitle(true);
        setTitle(e.title);
        setKeywords(e.keywords);
        setDateTo(e.dateTo);
        setDateFrom(e.dateFrom);
        setNewAnalysis(false);
        filter();
    }

    let targetLaunch = (e) => {
        setAnalysis([]);    
        let newAnalysis = [];   
        for(let analysis of analysisQue){
            if(analysis.id === e){
                newAnalysis.push(analysis);
                setOfTitle(false);
            }
        }
        setAnalysis(newAnalysis);
        setNewAnalysis(false);
    }
    //this code is where id does not show.
    let getData = async () => {
        let path = 'http://localhost:8080/analysis/all';
        try {
            let res = await axios.get(path);
            let target = JSOG.stringify(res.data);
            let newObject = JSOG.parse(target);
            setAnalysisQue(newObject["analysisData"]);
            setAnalysis(newObject["analysisData"]);
            console.log(newObject["analysisData"]);
        } catch (error) {
            console.log(error);
        }
    }

    let npon = () => {
        setEdit(true);
        setNewAnalysis(true);
        setIsTrue(true);
        getData();
    }

    let npoff = () => {
        setEdit(false);
        setNewAnalysis(false);
        setIsTrue(false);
        getData();
    }

    useEffect(() => {
        getData();
    }, []);

    return (
        <div>
            {isTrue && <AnalysisMenu
                search={(e) => { Filtering(e); }}
                newAnalysisOn={() => { npon(); }}
                newAnalysisOff={() => { npoff(); }}
            />}
            
            <button onClick={() => {setEdit(!edit); setNewAnalysis(false); setIsTrue(!isTrue);}}>ToChangeMode</button>
                
            {(edit && newAnalysis && props.id==-1) && <Analysis content={""} 
                    keyTakeaways={""} id={-1} toList={false}  title={""} dateOfAnalysis={""}
                    upCounter={() => {setCounter(counter + 1)}} edit={edit} toSwitch={true}/>
            }
            {props.id!=-1 && (analysis.map((analysis) => {
                    if(props.id===analysis.id){return (
                        <Analysis title={analysis.title} content={analysis.content} 
                            keyTakeaways={analysis.keyTakeaways} id={analysis.id}  toList={false}  key={analysis.id}
                            upCounter={() => {setCounter(counter + 1)}} edit={edit}  dateOfAnalysis={analysis.dateOfAnalysis}
                            target={(s) => {targetLaunch(s)}}   images={analysis.images} people={props.people}
                        />
                    );}
                }))}
            {(analysis.length > 0 && !newAnalysis && props.id===-1) && (analysis.map((analysis) => {
                return (
                    <Analysis title={analysis.title} content={analysis.content} 
                        keyTakeaways={analysis.keyTakeaways} id={analysis.id}  toList={ofTitle}  key={analysis.id}
                        upCounter={() => {setCounter(counter + 1)}} edit={edit}   dateOfAnalysis={analysis.dateOfAnalysis}
                    target={(s) => {targetLaunch(s)}}  images={analysis.images} people={props.people}
                    />
                );
            }))}
        </div>
    );
}

export default AnalysisContainer;
